import { HttpClient } from '@angular/common/http';
import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  public teams?: DTeam[];

  constructor(http: HttpClient) {
    http.get<DTeam[]>('/dictionary/get_teams').subscribe(result => {
      this.teams = result;
    }, error => console.error(error));
  }

  title = 'angularapp';
}

interface DTeam {
  id: number;
  nameTeam: string;
  acronymTeamNst: string;
  acronymTeamWolski: string;
  timestamp: Date;
  acronymTeamFiveThirtyEight: string
}

<h1 id="tableLabel">Weather forecast</h1>

<p>This component demonstrates fetching data from the server.</p>

<p *ngIf="!teams"><em>Loading... Please refresh once the ASP.NET backend has started. See <a href="https://aka.ms/jspsintegrationangular">https://aka.ms/jspsintegrationangular</a> for more details.</em></p>

<table *ngIf="forecasts">
    <thead>
        <tr>
            <th>Id</th>
            <th>Name. (C)</th>
            <th>Temp. (F)</th>
            <th>Summary</th>
        </tr>
    </thead>
    <tbody>
      <tr *ngFor="let forecast of forecasts">
        <td>{{ teams.Id }}</td>
        <td>{{ teams.nameTeam }}</td>
        <td>{{ teams.acronymTeamNst }}</td>
        <td>{{ teams.acronymTeamWolski }}</td>
        <td>{{ teams.timestamp }}</td>
        <td>{{ teams.acronymTeamFiveThirtyEight }}</td>
      </tr>
    </tbody>
</table>
